function Resume() {

    return(
        <div class="container">
            <div class="row">
                <a href={resume} download='resume-Justin-Hanson'><img src={iconDownload} class="img-download" /></a> 
                <p>
                    Please click the icon to download a pdf copy of my resume.  Thank you for visiting my site.
                </p>
            </div>
            <div class="row">
                <img src={resumeimage} />
            </div>
        </div>
    )
}

export default Resume;
